const initialState = {
  item: 'Learn about reducers',
  completed: false,
  id: 3892987589
}

const reducer = (state, action) => {
  switch(action.type) {
    case("SET_TODO"):
      return({...state})
    default:
      return(state);
  }
}

export {reducer, initialState};
